entreprendre autrement : l'engagement de l'association Pool d'Avenir est d'aider les porteurs de projet de son territoire (Lorraine - Champagne-Ardenne) à développer leur projet de création d'entreprise dans une perspective positive et à dimension humaine ; 
Cette association a pour objet de favoriser la réussite des projets de création d'entreprise en Lorraine - Champagne-Ardenne ; Elle assure l'accueil et l'accompagnement des porteurs de projet de création d'entreprise ; Elle propose un espace de test et de préparation à la création d'entreprise ; 
Plus généralement, l'objet de l'association concerne toutes opérations industrielles, commerciales ou financières, mobilières ou immobilières, pouvant se rattacher directement ou indirectement à l'objet social ou susceptibles d'en faciliter l'extension ou le développement ; 
Sa durée est illimitée ;

de réparer bénévolement les appareils et objets des particuliers afin d'éviter leur mise au rebut et de réduire la consommation de ressources nouvelles pour les remplacer;
