l'association Team Fleur a pour objet de produire, de développer et de promouvoir différents procédés de conception et de construction, de mobilier urbain et rural, à la sculpture monumentale pour l'espace public ou privé en passant par la micro-architecture ou le paysagisme ; Les objets créés sont à la croisée de l'art et de l'architecture ; 
L'association Team Fleur peut notamment concevoir des lieux de résidences avec accueil d'artistes et de public, produire des uvres, des publications et des expositions ; 
Les moyens d'action peuvent être plus généralement toutes opérations industrielles, commerciales ou financières, mobilières ou immobilières, pouvant se rattacher directement, ou indirectement à l'objet social, ou susceptibles d'en faciliter l'extension ou le développement ;

l'Association a pour but de construire une alliance stratégique territoriale d'intérêt général pour promouvoir l'ortie sous toutes ses formes et la valoriser dans le cadre d'innovations techniques et structurelles notamment dans son utilisation dans l'assainissement des eaux usées : 
 Education, formation et coordination de l'ensemble des acteurs ; 
