cette association a pour objet : 
1 / contribuer à la conservation de l'histoire des sapeurs-pompiers de la Meuse et à la mise en valeur de leur patrimoine, véhicules, matériels, habillements, documents historiques
 ; 
En collaboration avec le SDIS et l'UDSP l'association sera également attentive à : 
