l'Association « CLUB VITAFÉDÉ Meuse » a pour objet la pratique éducative de l'activité physique, afin de : 
- Créer une dynamique de prévention et d'éducation à la santé, 
- Favoriser, dans tous les milieux sociaux et sur tout le territoire, l'épanouissement de chacun par la pratique éducative des activités physiques, à toutes les périodes de la vie et, chaque fois qu'il se peut, en milieu naturel ; 
- Favoriser l'accès à la pratique sportive aux publics défavorisés, isolés ou fragilisés dans une dynamique d'inclusion sociale par le sport ; 
Le Club VitaFédé constitue un outil de développement au service du CODEP EPGV Meuse participant à la création, à l'accompagnement et au développement de la pratique de l'Education Physique et de la Gymnastique Volontaire sur le département ;

